import React from 'react'

const Cards = ({results}) => {
    let display;

    if (results){
        display = results.map(x=>{
            let {id, name, image} = x
            return(<div key={id} className="col-12">
                <div>
                    <img src={image} alt="" className="img-fluid"/>
                </div>
            </div>)
        });
    }else{
        display = "No existe" ;
    }



  return (
    <div>{display}</div>
  )
}

export default Cards
